import React from 'react';
import Canvas from './Canvas';

function App() {
  const drawArt = (ctx: CanvasRenderingContext2D) => {
    ctx.fillStyle = 'red';
    ctx.fillRect(0, 0, 100, 100);
  };
  return (
    <>
      <div
        style={{
          display: 'flex',
          outline: '1px solid black',
          justifyContent: 'center',
          alignItems: 'center',
          height: '600px',
          width: '800px',
        }}
      >
        <Canvas
          style={{
            outline: '1px solid black',
          }}
          draw={drawArt}
          width={600}
          height={400}
        ></Canvas>
      </div>
    </>
  );
}

export default App;
